  additionalClasses = (svgID) => {
    const {scoreSheet, activeCategory, activeTest} = this.props;
    const bodyPart = svgID.replace(/-.+$/, '');
    let side = svgID.replace(/^.+-/, '');

    if (side === 'SIDE') {
      side = 'L';
    }

    const bodyPartScore = scoreSheet.get(bodyPart);
    let classes = [];

    if (bodyPartScore) {
      const scoreable = bodyPartScore.getIn([activeCategory, activeTest]);

      if (scoreable) {
        classes.push('scoreable');

        const value = bodyPartScore.getIn([activeCategory, activeTest, side]);

        if (value === 0 || value) {
          classes.push(`complete value-${value}`);
        }
      }
    }

    return classes.join(' ');
  }

  onClick = (e) => {
    e.preventDefault();
    this.props.openModal(e.target.id);
  }
